  `template_hash` varbinary(255) DEFAULT NULL COMMENT 'Hash of the template bytes for integrity/versioning, not reversible.',
  `label` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Friendly display label, e.g., Blue HID fob',
