  `export_path` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Server path for file exports when destination is path',
  `last_connected_at` timestamp NULL DEFAULT NULL COMMENT 'Last successful connection',
