-- Table structure for integration_sync_logs
-- ----------------------------
DROP TABLE IF EXISTS `integration_sync_logs`;
CREATE TABLE `integration_sync_logs` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT 'Primary key',
  `connection_id` bigint unsigned NOT NULL COMMENT 'Foreign key to integration_connections',
  `object_id` bigint unsigned DEFAULT NULL COMMENT 'Foreign key to integration_objects',
  `template_id` bigint unsigned DEFAULT NULL COMMENT 'Foreign key to integration_query_templates',
  `operation` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Operation type: pull, push, test, discover',
  `status` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Status: pending, running, success, failed, partial',
  `started_at` timestamp NOT NULL COMMENT 'When the sync started',
  `completed_at` timestamp NULL DEFAULT NULL COMMENT 'When the sync completed',
  `duration_ms` int DEFAULT NULL COMMENT 'Duration in milliseconds',
  `records_fetched` int NOT NULL DEFAULT '0' COMMENT 'Records retrieved from API',
  `records_created` int NOT NULL DEFAULT '0' COMMENT 'New local records created',
  `records_updated` int NOT NULL DEFAULT '0' COMMENT 'Existing records updated',
  `records_skipped` int NOT NULL DEFAULT '0' COMMENT 'Records skipped (no changes)',
  `records_failed` int NOT NULL DEFAULT '0' COMMENT 'Records that failed to process',
  `request_payload` json DEFAULT NULL COMMENT 'The API request sent',
  `response_summary` json DEFAULT NULL COMMENT 'Summary of response (not full data)',
  `error_message` text COLLATE utf8mb4_unicode_ci COMMENT 'Error message if failed',
  `error_details` json DEFAULT NULL COMMENT 'Detailed error info (stack trace, etc.)',
  `failed_records` json DEFAULT NULL COMMENT 'List of record IDs that failed',
  `triggered_by` bigint unsigned DEFAULT NULL COMMENT 'User who triggered sync (null = scheduled)',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `integration_sync_logs_object_id_foreign` (`object_id`),
  KEY `integration_sync_logs_template_id_foreign` (`template_id`),
  KEY `integration_sync_logs_triggered_by_foreign` (`triggered_by`),
  KEY `integration_sync_logs_connection_id_started_at_index` (`connection_id`,`started_at`),
  KEY `integration_sync_logs_status_started_at_index` (`status`,`started_at`),
