-- ----------------------------
-- View structure for anniversary_vacation_status
-- ----------------------------
DROP VIEW IF EXISTS `anniversary_vacation_status`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `anniversary_vacation_status` AS select `e`.`id` AS `employee_id`,`e`.`first_name` AS `first_name`,`e`.`last_name` AS `last_name`,`e`.`date_of_hire` AS `date_of_hire`,(case when (`e`.`date_of_hire` is null) then NULL else (`e`.`date_of_hire` + interval floor(((to_days(curdate()) - to_days(`e`.`date_of_hire`)) / 365.25)) year) end) AS `last_anniversary_date`,(case when (`e`.`date_of_hire` is null) then NULL else (`e`.`date_of_hire` + interval (floor(((to_days(curdate()) - to_days(`e`.`date_of_hire`)) / 365.25)) + 1) year) end) AS `next_anniversary_date`,floor(((to_days(curdate()) - to_days(`e`.`date_of_hire`)) / 365.25)) AS `completed_years`,coalesce(`current_accruals`.`current_year_accrued`,0) AS `current_year_accrued`,coalesce(`current_used`.`current_year_used`,0) AS `current_year_used`,`vp`.`policy_name` AS `policy_name`,`vp`.`vacation_hours_per_year` AS `annual_entitlement`,(case when (`e`.`date_of_hire` is null) then 0 when (curdate() >= (`e`.`date_of_hire` + interval (floor(((to_days(curdate()) - to_days(`e`.`date_of_hire`)) / 365.25)) + 1) year)) then 1 else 0 end) AS `is_due_for_accrual` from ((((`employees` `e` left join `employee_vacation_assignments` `eva` on(((`eva`.`employee_id` = `e`.`id`) and (`eva`.`is_active` = 1) and (`eva`.`effective_date` <= curdate()) and ((`eva`.`end_date` is null) or (`eva`.`end_date` >= curdate()))))) left join `vacation_policies` `vp` on((`vp`.`id` = `eva`.`vacation_policy_id`))) left join (select `vt`.`employee_id` AS `employee_id`,sum(`vt`.`hours`) AS `current_year_accrued` from (`vacation_transactions` `vt` join `employees` `e2` on((`e2`.`id` = `vt`.`employee_id`))) where ((`vt`.`transaction_type` = 'accrual') and (`vt`.`transaction_date` >= (`e2`.`date_of_hire` + interval floor(((to_days(curdate()) - to_days(`e2`.`date_of_hire`)) / 365.25)) year)) and (`vt`.`transaction_date` < (`e2`.`date_of_hire` + interval (floor(((to_days(curdate()) - to_days(`e2`.`date_of_hire`)) / 365.25)) + 1) year))) group by `vt`.`employee_id`) `current_accruals` on((`current_accruals`.`employee_id` = `e`.`id`))) left join (select `vt`.`employee_id` AS `employee_id`,abs(sum(`vt`.`hours`)) AS `current_year_used` from (`vacation_transactions` `vt` join `employees` `e2` on((`e2`.`id` = `vt`.`employee_id`))) where ((`vt`.`transaction_type` = 'usage') and (`vt`.`transaction_date` >= (`e2`.`date_of_hire` + interval floor(((to_days(curdate()) - to_days(`e2`.`date_of_hire`)) / 365.25)) year)) and (`vt`.`transaction_date` < (`e2`.`date_of_hire` + interval (floor(((to_days(curdate()) - to_days(`e2`.`date_of_hire`)) / 365.25)) + 1) year))) group by `vt`.`employee_id`) `current_used` on((`current_used`.`employee_id` = `e`.`id`))) where ((`e`.`is_active` = 1) and (`e`.`date_of_hire` is not null));

-- ----------------------------
