-- ----------------------------
DROP VIEW IF EXISTS `employee_vacation_summary`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `employee_vacation_summary` AS select `e`.`id` AS `employee_id`,`e`.`first_name` AS `first_name`,`e`.`last_name` AS `last_name`,`e`.`date_of_hire` AS `date_of_hire`,(case when (`e`.`date_of_hire` is null) then 0 else floor(((to_days(curdate()) - to_days(`e`.`date_of_hire`)) / 365.25)) end) AS `years_of_service`,`eva`.`vacation_policy_id` AS `vacation_policy_id`,`vp`.`policy_name` AS `policy_name`,`vp`.`vacation_days_per_year` AS `vacation_days_per_year`,`vp`.`vacation_hours_per_year` AS `vacation_hours_per_year`,coalesce(`accruals`.`total_accrued`,0) AS `total_accrued`,coalesce(`used_hours`.`total_used`,0) AS `total_used`,coalesce(`adjustments`.`total_adjustments`,0) AS `total_adjustments`,((coalesce(`accruals`.`total_accrued`,0) - coalesce(`used_hours`.`total_used`,0)) + coalesce(`adjustments`.`total_adjustments`,0)) AS `current_balance`,`cs`.`vacation_accrual_method` AS `vacation_accrual_method`,`cs`.`max_accrual_balance` AS `max_accrual_balance`,`cs`.`max_carryover_hours` AS `max_carryover_hours`,`last_trans`.`last_transaction_date` AS `last_transaction_date` from (((((((`employees` `e` left join `employee_vacation_assignments` `eva` on(((`eva`.`employee_id` = `e`.`id`) and (`eva`.`is_active` = 1) and (`eva`.`effective_date` <= curdate()) and ((`eva`.`end_date` is null) or (`eva`.`end_date` >= curdate()))))) left join `vacation_policies` `vp` on((`vp`.`id` = `eva`.`vacation_policy_id`))) left join `company_setup` `cs` on((`cs`.`id` = 1))) left join (select `vacation_transactions`.`employee_id` AS `employee_id`,sum(`vacation_transactions`.`hours`) AS `total_accrued` from `vacation_transactions` where (`vacation_transactions`.`transaction_type` = 'accrual') group by `vacation_transactions`.`employee_id`) `accruals` on((`accruals`.`employee_id` = `e`.`id`))) left join (select `vacation_transactions`.`employee_id` AS `employee_id`,abs(sum(`vacation_transactions`.`hours`)) AS `total_used` from `vacation_transactions` where (`vacation_transactions`.`transaction_type` = 'usage') group by `vacation_transactions`.`employee_id`) `used_hours` on((`used_hours`.`employee_id` = `e`.`id`))) left join (select `vacation_transactions`.`employee_id` AS `employee_id`,sum(`vacation_transactions`.`hours`) AS `total_adjustments` from `vacation_transactions` where (`vacation_transactions`.`transaction_type` = 'adjustment') group by `vacation_transactions`.`employee_id`) `adjustments` on((`adjustments`.`employee_id` = `e`.`id`))) left join (select `vacation_transactions`.`employee_id` AS `employee_id`,max(`vacation_transactions`.`transaction_date`) AS `last_transaction_date` from `vacation_transactions` group by `vacation_transactions`.`employee_id`) `last_trans` on((`last_trans`.`employee_id` = `e`.`id`))) where (`e`.`is_active` = 1);

-- ----------------------------
-- View structure for vacation_accrual_history
-- ----------------------------
DROP VIEW IF EXISTS `vacation_accrual_history`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vacation_accrual_history` AS select `vt`.`id` AS `id`,`vt`.`employee_id` AS `employee_id`,`e`.`first_name` AS `first_name`,`e`.`last_name` AS `last_name`,`vt`.`transaction_type` AS `transaction_type`,`vt`.`hours` AS `hours`,`vt`.`transaction_date` AS `transaction_date`,`vt`.`effective_date` AS `effective_date`,`vt`.`accrual_period` AS `accrual_period`,`vt`.`description` AS `description`,(select coalesce(sum((case when (`vt2`.`transaction_type` = 'accrual') then `vt2`.`hours` when (`vt2`.`transaction_type` = 'usage') then `vt2`.`hours` when (`vt2`.`transaction_type` = 'adjustment') then `vt2`.`hours` else 0 end)),0) from `vacation_transactions` `vt2` where ((`vt2`.`employee_id` = `vt`.`employee_id`) and (`vt2`.`transaction_date` <= `vt`.`transaction_date`) and (`vt2`.`id` <= `vt`.`id`))) AS `running_balance`,`vp`.`policy_name` AS `policy_name`,`vp`.`vacation_hours_per_year` AS `vacation_hours_per_year` from (((`vacation_transactions` `vt` join `employees` `e` on((`e`.`id` = `vt`.`employee_id`))) left join `employee_vacation_assignments` `eva` on(((`eva`.`employee_id` = `vt`.`employee_id`) and (`eva`.`effective_date` <= `vt`.`transaction_date`) and ((`eva`.`end_date` is null) or (`eva`.`end_date` >= `vt`.`transaction_date`))))) left join `vacation_policies` `vp` on((`vp`.`id` = `eva`.`vacation_policy_id`))) order by `vt`.`employee_id`,`vt`.`transaction_date`,`vt`.`id`;

-- ----------------------------
-- Procedure structure for fix_shift_schedules
-- ----------------------------
DROP PROCEDURE IF EXISTS `fix_shift_schedules`;
delimiter ;;
CREATE PROCEDURE `fix_shift_schedules`()
BEGIN
  DECLARE fk_name VARCHAR(255);

  
  SELECT CONSTRAINT_NAME
    INTO fk_name
  FROM information_schema.KEY_COLUMN_USAGE
  WHERE TABLE_SCHEMA = DATABASE()
    AND TABLE_NAME = 'shift_schedules'
    AND COLUMN_NAME = 'department_id'
    AND REFERENCED_TABLE_NAME = 'departments'
  LIMIT 1;

  IF fk_name IS NOT NULL THEN
    SET @sql = CONCAT('ALTER TABLE shift_schedules DROP FOREIGN KEY ', fk_name);
    PREPARE stmt FROM @sql; EXECUTE stmt; DEALLOCATE PREPARE stmt;
  END IF;

  
  IF EXISTS (
    SELECT 1 FROM information_schema.COLUMNS
    WHERE TABLE_SCHEMA = DATABASE()
      AND TABLE_NAME = 'shift_schedules'
      AND COLUMN_NAME = 'department_id'
  ) THEN
    ALTER TABLE shift_schedules DROP COLUMN department_id;
  END IF;

  
  IF NOT EXISTS (
    SELECT 1 FROM information_schema.COLUMNS
    WHERE TABLE_SCHEMA = DATABASE()
      AND TABLE_NAME = 'shift_schedules'
      AND COLUMN_NAME = 'shift_id'
  ) THEN
    ALTER TABLE shift_schedules
      ADD COLUMN shift_id BIGINT UNSIGNED NULL AFTER employee_id;
  END IF;

  
  SELECT CONSTRAINT_NAME
    INTO fk_name
  FROM information_schema.KEY_COLUMN_USAGE
  WHERE TABLE_SCHEMA = DATABASE()
    AND TABLE_NAME = 'shift_schedules'
    AND COLUMN_NAME = 'shift_id'
    AND REFERENCED_TABLE_NAME = 'shifts'
  LIMIT 1;

  IF fk_name IS NULL THEN
    ALTER TABLE shift_schedules
      ADD CONSTRAINT shift_schedules_shift_id_foreign
      FOREIGN KEY (shift_id) REFERENCES shifts(id)
      ON DELETE SET NULL ON UPDATE CASCADE;
  END IF;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for InsertAttendanceTimeGroups
-- ----------------------------
DROP PROCEDURE IF EXISTS `InsertAttendanceTimeGroups`;
delimiter ;;
CREATE PROCEDURE `InsertAttendanceTimeGroups`()
BEGIN
    DECLARE flex_minutes INT;

    
    SELECT COALESCE(attendance_flexibility_minutes, 30)
    INTO flex_minutes
    FROM company_setup
    LIMIT 1;

    
    DELETE FROM attendance_time_groups;

    
        employee_id,
        external_group_id,
        shift_date,
        shift_window_start,
        shift_window_end,
        lunch_start_time,
        lunch_end_time,
        created_at,
        updated_at
    )
    SELECT
        MIN(employee_id) AS employee_id,  
        external_group_id,
        shift_date,
        MIN(shift_window_start) AS shift_window_start,
        MAX(shift_window_end) AS shift_window_end,  
        MIN(lunch_start_time) AS lunch_start_time,  
        MAX(lunch_end_time) AS lunch_end_time,      
        NOW() AS created_at,
        NOW() AS updated_at
    FROM (
        SELECT
            e.id AS employee_id,

            
            CONCAT(e.external_id, '_', DATE_FORMAT(
                CASE
                    WHEN sh.multi_day_shift = 1 AND TIME(a.punch_time) < '12:00:00'
                        THEN DATE_SUB(DATE(a.punch_time), INTERVAL 1 DAY)
                    ELSE DATE(a.punch_time)
                END, '%Y%m%d'
            )) AS external_group_id,

            
            CASE
                WHEN sh.multi_day_shift = 1 AND TIME(a.punch_time) < '12:00:00'
                    THEN DATE_SUB(DATE(a.punch_time), INTERVAL 1 DAY)
                ELSE DATE(a.punch_time)
            END AS shift_date,

            
            TIMESTAMP(DATE(a.punch_time),
                LEAST(ss.start_time, '23:59:59')
            ) AS shift_window_start,

            TIMESTAMP(DATE_ADD(DATE(a.punch_time), INTERVAL 1 DAY),
                GREATEST(ss.end_time, '00:00:00')
            ) AS shift_window_end,

            
            TIMESTAMP(DATE(a.punch_time),
                COALESCE(ss.lunch_start_time, '12:00:00')
            ) AS lunch_start_time,

            TIMESTAMP(DATE(a.punch_time),
                ADDTIME(COALESCE(ss.lunch_start_time, '12:00:00'),
                SEC_TO_TIME(COALESCE(ss.lunch_duration, 30) * 60))
            ) AS lunch_end_time

        FROM attendances a
        JOIN employees e ON a.employee_id = e.id
        LEFT JOIN shift_schedules ss
            ON ss.employee_id = e.id
            OR (ss.department_id = e.department_id AND ss.employee_id IS NULL)
        JOIN shifts sh ON ss.shift_id = sh.id
    ) AS grouped_results
    GROUP BY external_group_id, shift_date;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for MatchAttendanceToTimeGroups
-- ----------------------------
DROP PROCEDURE IF EXISTS `MatchAttendanceToTimeGroups`;
delimiter ;;
CREATE PROCEDURE `MatchAttendanceToTimeGroups`()
BEGIN
    DECLARE flex_minutes INT;

    
    SELECT COALESCE(attendance_flexibility_minutes, 30)
    INTO flex_minutes
    FROM company_setup
    LIMIT 1;

    
    UPDATE attendances
    SET
        external_group_id = NULL,
        shift_date = NULL
    WHERE external_group_id IS NOT NULL OR shift_date IS NOT NULL;

    
    UPDATE attendances a
    JOIN (
        SELECT
            g.employee_id,
            g.external_group_id,
            g.shift_date,
            g.shift_window_start,
            g.shift_window_end,
            e.shift_id
        FROM attendance_time_groups g
        JOIN employees e ON g.employee_id = e.id
    ) AS matched_groups
    ON a.employee_id = matched_groups.employee_id
    AND (
        
        (a.punch_time BETWEEN matched_groups.shift_window_start AND matched_groups.shift_window_end)

        
        OR (a.punch_time >= SUBTIME(matched_groups.shift_window_start, SEC_TO_TIME(flex_minutes * 60))
            AND a.punch_time < matched_groups.shift_window_start)
    )
    SET
        a.external_group_id = matched_groups.external_group_id,

        
        a.shift_date = CASE
            
            WHEN matched_groups.shift_id = 1 THEN DATE(a.punch_time)

            
            WHEN matched_groups.shift_id = 2
                 AND TIME(a.punch_time) BETWEEN '00:00:00' AND '05:00:00'
                 THEN DATE_SUB(DATE(a.punch_time), INTERVAL 1 DAY)

            
            ELSE DATE(a.punch_time)
        END;

    
    UPDATE attendances
    SET external_group_id = 'UNMATCHED'
    WHERE external_group_id IS NULL;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for ResetAttendanceAndPunches
-- ----------------------------
DROP PROCEDURE IF EXISTS `ResetAttendanceAndPunches`;
delimiter ;;
CREATE PROCEDURE `ResetAttendanceAndPunches`()
BEGIN
    
    UPDATE attendances
    SET
        punch_type_id = NULL,
        status = 'Incomplete',
				punch_state = NULL,
				external_group_id = NULL,
				shift_date = NULL,
        is_migrated = 0,
        issue_notes = NULL,
        classification_id = NULL;

    
    DELETE FROM attendances WHERE holiday_id IS NOT NULL;

    
    DELETE FROM punches;

END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table attendances
-- ----------------------------
DROP TRIGGER IF EXISTS `validate_punch_time`;
delimiter ;;
CREATE TRIGGER `timeattendance`.`validate_punch_time` BEFORE INSERT ON `attendances` FOR EACH ROW BEGIN
                IF NEW.punch_time IS NULL THEN
                    SIGNAL SQLSTATE '45000'
                    SET MESSAGE_TEXT = 'Punch time cannot be NULL.';
                END IF;
            END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table attendances
-- ----------------------------
DROP TRIGGER IF EXISTS `set_employee_id_from_external_id`;
delimiter ;;
CREATE TRIGGER `timeattendance`.`set_employee_id_from_external_id` BEFORE INSERT ON `attendances` FOR EACH ROW BEGIN
                
                IF NEW.employee_id IS NULL AND NEW.employee_external_id IS NOT NULL THEN
                    SET NEW.employee_id = (
                        SELECT id
                        FROM employees
                        WHERE external_id = NEW.employee_external_id
                        LIMIT 1
                    );
                END IF;

                
                IF NEW.employee_external_id IS NULL AND NEW.employee_id IS NOT NULL THEN
                    SET NEW.employee_external_id = (
                        SELECT external_id
                        FROM employees
                        WHERE id = NEW.employee_id
                        LIMIT 1
                    );
                END IF;
            END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table attendances
-- ----------------------------
DROP TRIGGER IF EXISTS `set_status_default`;
delimiter ;;
CREATE TRIGGER `timeattendance`.`set_status_default` BEFORE INSERT ON `attendances` FOR EACH ROW BEGIN
                IF NEW.status IS NULL OR NEW.status = '' THEN
                    SET NEW.status = 'Incomplete';
                END IF;
            END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table attendances
-- ----------------------------
DROP TRIGGER IF EXISTS `set_status_on_update`;
delimiter ;;
CREATE TRIGGER `timeattendance`.`set_status_on_update` BEFORE UPDATE ON `attendances` FOR EACH ROW BEGIN
                IF NEW.status = 'Migrated' THEN
                    SET NEW.is_migrated = 1;
                END IF;
            END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table employees
-- ----------------------------
DROP TRIGGER IF EXISTS `insert_full_name`;
delimiter ;;
CREATE TRIGGER `timeattendance`.`insert_full_name` BEFORE INSERT ON `employees` FOR EACH ROW BEGIN
                SET NEW.full_names = CONCAT(
                    UCASE(LEFT(NEW.first_name, 1)), LCASE(SUBSTRING(NEW.first_name, 2)), ' ',
                    UCASE(LEFT(NEW.last_name, 1)), LCASE(SUBSTRING(NEW.last_name, 2))
                );
            END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table employees
-- ----------------------------
DROP TRIGGER IF EXISTS `update_full_name`;
delimiter ;;
CREATE TRIGGER `timeattendance`.`update_full_name` BEFORE UPDATE ON `employees` FOR EACH ROW BEGIN
                SET NEW.full_names = CONCAT(
                    UCASE(LEFT(NEW.first_name, 1)), LCASE(SUBSTRING(NEW.first_name, 2)), ' ',
                    UCASE(LEFT(NEW.last_name, 1)), LCASE(SUBSTRING(NEW.last_name, 2))
                );
            END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table punches
-- ----------------------------
DROP TRIGGER IF EXISTS `before_punch_time_update`;
delimiter ;;
CREATE TRIGGER `timeattendance`.`before_punch_time_update` BEFORE UPDATE ON `punches` FOR EACH ROW SET NEW.is_altered = IF(NEW.punch_time <> OLD.punch_time, 1, NEW.is_altered)
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table rounding_rules
-- ----------------------------
DROP TRIGGER IF EXISTS `before_insert_rounding_rules`;
delimiter ;;
CREATE TRIGGER `timeattendance`.`before_insert_rounding_rules` BEFORE INSERT ON `rounding_rules` FOR EACH ROW BEGIN
                IF NEW.minute_min > NEW.minute_max THEN
                    SIGNAL SQLSTATE '45000'
                    SET MESSAGE_TEXT = 'minute_min cannot be greater than minute_max';
                END IF;
            END
;;
delimiter ;

